import React from 'react';
import { Link } from 'react-router-dom';
import '../index.scss';

export default function Menu() {
    return (
        <div className="grid">
          <div className="col">stphnhthwy.</div>
          <ul className="col">
              <li><Link to="/">work.</Link></li>
              <li><Link to="/about">about.</Link></li>
          </ul>
        </div>
    );
}
